import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = ({ user }) => {
  return (
    <nav style={styles.nav}>
      <ul style={styles.ul}>
        <li style={styles.li}><Link to="/authpage" style={styles.link}>Sign Up</Link></li>
        <li style={styles.li}><Link to="/journal" style={styles.link}>Journal Entry</Link></li>
        <li style={styles.li}><Link to="/another" style={styles.link}>Another Page</Link></li>
        {user && <li style={styles.username}>{user.username}</li>}
      </ul>
    </nav>
  );
};

const styles = {
  nav: {
    background: '#333',
    padding: '10px',
  },
  ul: {
    listStyleType: 'none',
    margin: 0,
    padding: 0,
    display: 'flex',
    justifyContent: 'space-around',
  },
  li: {
    display: 'inline',
  },
  link: {
    color: '#fff',
    textDecoration: 'none',
    fontSize: '18px',
  },
  username: {
    color: '#fff',
    fontSize: '18px',
  },
};

export default Navbar;
